(1, NULL, 0, 0, 179, 'Duy trì kinh phí sử dụng sever (Mỗi năm gia hạn một lần).', '<p><span style=\"font-size:20px\">-<span style=\"color:#2ecc71\"> <strong>Gửi ban l&atilde;nh đạo về tổng cộng tất cả c&aacute;c chi ph&iacute; để duy tr&igrave; một sever tr&ecirc;n website trong một năm v&agrave; l&yacute; do tại sao cần chi c&aacute;c mục đ&oacute;;</strong></span></span></p>\r\n\r\n<p><span style=\"color:#2ecc71\"><strong><span style=\"font-size:20px\">-</span></strong></span><span style=\"color:#9b59b6\"><strong><span style=\"font-size:20px\"> Trong b&aacute;o c&aacute;o sẽ c&oacute; chi tiết c&aacute;c khoản phải chi, l&yacute; do phải chi để mọi người lắm được chi ph&iacute; tổng cộng của việc duy tr&igrave; một website, tại sao cần c&oacute; c&aacute;c chi ph&iacute; đ&oacute; v&agrave; thời điểm cần gia hạn th&ecirc;m.</span></strong></span></p>\r\n\r\n<p><span style=\"color:#2ecc71\"><strong><span style=\"font-size:20px\">- </span></strong></span><span style=\"color:#e74c3c\"><strong><span style=\"font-size:20px\">C&aacute;c chi ph&iacute; n&agrave;y gần như sẽ cố định hằng năm đến kỳ cần gia hạn n&ecirc;n trước thời điểm cần </span></strong></span><span style=\"color:#c0392b\"><strong><span style=\"font-size:20px\">gia hạn 30 ng&agrave;y của mỗi kỳ gia hạn</span></strong></span><span style=\"color:#e74c3c\"><strong><span style=\"font-size:20px\">, b&ecirc;n ph&ograve;ng ph&aacute;t triển phần mềm sẽ y&ecirc;u cầu kế to&aacute;n xuất chi ph&iacute; ngay tại tab c&ocirc;ng việc n&agrave;y</span></strong></span></p>\r\n\r\n<p><span style=\"color:#2ecc71\"><strong><span style=\"font-size:20px\">-</span></strong></span><span style=\"color:#e74c3c\"><strong><span style=\"font-size:20px\"> Ho&aacute; đơn đỏ </span></strong></span><span style=\"color:#2ecc71\"><strong><span style=\"font-size:20px\">của mỗi lần gia hạn cũng sẽ được gửi trực tiếp l&ecirc;n tab c&ocirc;ng việc n&agrave;y để minh bạch v&agrave; tiện cho việc theo d&otilde;i của ph&ograve;ng kế to&aacute;n.</span></strong></span></p>', '2022-01-13', '2023-01-13', 0, '2022-01-13 12:39:08', '2022-01-13 12:39:08'),
(2, NULL, 0, 0, 179, 'Làm module tài chính', '<p>+ deadline ho&agrave;n th&agrave;nh: trước khi b&agrave;n giao (thời gian b&agrave;n giao: đầu th&aacute;ng 2/2022).</p>\r\n\r\n<p>+phần n&agrave;y cần tham vấn b&ecirc;n ch&uacute; Thắng TEG v&agrave; một số người b&ecirc;n đ&oacute;.</p>\r\n\r\n<p>+chia giai đoạn: tham vấn b&ecirc;n TEG --&gt; ph&ograve;ng ph&aacute;t triển dự &aacute;n thảo luận ----&gt; code, ho&agrave;n thiện ----&gt; thử nghiệm, test ----&gt; nghiệm thu.</p>\r\n\r\n<p>+việc tham vấn b&ecirc;n TEG sẽ diễn ra khi ho&agrave;n thiện xong c&aacute;c c&ocirc;ng việc hiện tại về phần ph&aacute;p l&yacute;; nh&acirc;n sự; giao việc; kho.</p>', '2022-01-14', '2022-01-24', 2, '2022-01-14 02:07:37', '2022-01-14 02:07:37'),
(3, NULL, 2, 2, 179, 'Tạo tài khoản cho chú Thắng TEG, Chủ nhật chú sẽ xem và cho ý kiến', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2022-01-14', '2022-01-21', 0, '2022-01-14 03:10:22', '2022-01-14 03:10:22'),
(4, NULL, 2, 2, 179, 'code và hoàn thiện', '<p><span style=\"font-size:26px\">Dũng code v&agrave; ho&agrave;n hiện, trong qu&aacute; tr&igrave;nh code c&oacute; &yacute; tưởng hay định l&agrave;m g&igrave; th&igrave; trao đổi với mọi người ở tab n&agrave;y để mọi người g&oacute;p &yacute;</span></p>', '2022-01-14', '2022-01-27', 0, '2022-01-14 03:11:37', '2022-01-14 03:11:37'),
